c("Preheat oven to 450 degrees F.", "Combine dry ingredients.", "Cut in shortening with two knives or a pastry  blender until mixture resembles coarse cornmeal.", "Make a well in the centre  and add liquid all at once. Stir vigorously until dough comes freely from  the sides of the bowl.", "Turn dough onto a lightly floured board and roll or  pat to 1/2-inch thick.", "Cut out 2-inch biscuits with a floured water glass  or biscuit cutter.", "Place on an ungreased baking sheet. Bake for 12 to 15  minutes, until tops are golden brown.", 
"Serve immediately with butter, jam or  honey.", "Variations:  Cheese Tea Biscuits  Use only 3/4 tsp salt and 1/4 cup shortening.", "Add 3/4 cup shredded cheese (yellow or marble) to dry ingredients.", "Buttermilk Tea Biscuits  Use only 2 tsp baking powder  Add 1/2 tsp baking soda  Replace milk with 1 cup   buttermilk or sour milk.", "Raisin or Nut Tea Biscuits  Add to dry ingredients  1/4 cup sugar; and  3/4 cup seedless raisins or chopped nuts  Use only 7/8 cup milk  Whole Wheat Tea Biscuits  Replace 1 cup of white flour with 1 cup whole wheat flour."
)

c("Preheat oven to 450 degrees F.", "Combine dry ingredients.", "Cut in shortening with two knives or a pastry blender until mixture has the consistency of coarse cornmeal.", "Set aside. Reserve a little of the egg whites (to brush over tops of scones) and beat eggs until light. Stir in milk.", "Make a well in the dry ingredients and add liquid all at once, stirring with a fork vigorously until dough comes freely from the sides of the bowl.", "Turn dough out onto a lightly floured surface and pat dough out to 3/4-inch thickness.", 
"Cut into 8 triangles or squares or form into \"biscuits\".", "Brush tops with egg whites and sprinkle generously with sugar.", "place on an ungreased baking sheet. Bake for 12 to 15 minutes or until tops are golden.", "Variations: Raisin Scones Add to dry ingredients 1/2 cup seedless raisins, currants, Craisins or other fruits (fresh blueberries or raspberries, apple chunks etc). Cheese Scones Reduce sugar to 1 tsp Add 1 cup of shredded sharp cheese to dry ingredients.", "Do Not sprinkle with sugar before baking."
)

c("To prepare crust, place coconut in thin layer on 2 (10 x 13-inch) cookie sheets.", "Toast coconut in 350 degrees oven for 10 minutes or until light golden brown.", "Stir frequently, and watch carefully.", "Remove from oven and let cool.", "Meanwhile,  reduce the oven to 250 degrees.", "In small mixing bowl, beat egg whites to stiff  peaks, then slowly beat in superfine sugar until completely dissolved.", "Fold in  cooled coconut. Press this mixture into greased 9-inch pie plate and bake at 250  degrees for 7 minutes and set. Remove from oven and let cool.", 
"To make filling:", "Blend together sweetened  condensed milk, lime juice, lime rind and rum in large  mixing bowl.", "Beat in the egg yolks.", "Gently mix in sour cream to combine well.", "Pour into cooled crust. Swirl meringue over top of filling.", "Bake in 350 degrees  oven 20 minutes or until meringue is nicely browned.", "Cool, then chill at least  30 minutes before serving.", "To make Meringue:", "Beat egg whites in large mixing bowl until soft peaks are formed.", "Gradually beat  in sugar until whites are stiff, but not dry, being sure the sugar is dissolved."
)

c("Heat oven to 375Â°F.", "Grease baking sheet.", "Combine Butter Flavor Crisco, sugar and milk  in medium bowl.", "Beat at medium speed of electric mixer until well blended.", "Beat in egg and vanilla; beat until blended.", "Combine flour, salt and baking powder.", "Mix into creamed mixture at low speed until just blended.", "Drop by level tablespoonfuls of dough 2-inches apart onto baking sheet.", "Bake at 375Â°F for 7-9 minutes or until set.", "Cool 2 minutes on baking sheet.  Remove to cooling rack.", 
"There are several variations that can be used with these cookies such as frosting them as wreaths or ornaments for the holiday season.", "Using a chocolate frosting between two cookies for a sandwich.", "Or dipping 1/2 of the cookie into chocolate frosting then into nuts.", "NOTE: For larger cookies, drop by tablespoonfuls of dough into a mound for each cookie.  Place 3-inches apart on baking sheet.  Bake at 375Â°F for 11-13 minutes, or until set.  Cool 2 minutes on baking sheet. Remove to cooling rack."
)

c("In large bowl, combine dressi ng ingredients; whisk until blended.", "Place beef  steak in plastic bag; add 3/4 of dressing, turning to coat. Close bag securely  and marinate in refrigerator 10 minutes.", "Meanwhile add coleslaw mix, green onions, salt and pepper to remaining 1/4 of dressing  in bowl; toss.", "Set aside. Wrap tortillas in aluminum foil.", "Remove steak from  dressing; discard dressing.", "Place steak on grid over medium, ash-covered coals.", "Grill, uncovered, 17 to 21 minutes fro medium rare to medium doneness, turning  once. A few minutes before steak is done, place tortilla packet on grid near  edge of grill to heat. Remove steak from grill; let rest 2 to 3 minutes.", 
"Season  steak with salt and pepper, as desired; carve diagonally into thin slices.", "To  assemble, layer an equal amount of beef, coleslaw mixture and the peanuts down center of each tortilla.", "Fold bottom edge of tortilla up over  filling.", "Fold right and left sides to center, overlapping edges.", "Garnish with  green onion and  peanuts, if desired.", "Tip: To broil, place steak on rack in broiler pan so surface of meat is 2 to 3  inches from heat. Broil 13 to 18 minutes, turning once. Thinly sliced green  cabbage may be substituted for packaged coleslaw mix."
)

c("Cut pork across into 3/4 inch slices.", "then cut into 2 X 1 inch pieces.", "combine with chicken pieces in large bowl.", "Mix vinegar,soy sauce, garlic, salt and pepper in a small bowl; pour over pork and chicken.", "Marinate at room temperature , stirring occasionally, 1 hour.", "Transfer pork-chicken mixture in medium nonaluminum saucepan, stir in water.", "Heat over medium heat to boiling.", "Reduce heat to = low, simmer covered until pork and chicken are tender, about 30 minutes.emove pork and chicken with slotted spoon, draining well.", 
"Transfer to plate.  Cook vinegar mixture over high heat until reduced to coating consistency , about 15 mi nutes.", "While sauce is reducing, heat oil in medium skillet over medium hear add pork.", "Cook , turning frequently , until brown on all sides, about 3 minutes.", "Remove to plate.  Add chicken to skillet, turning once until brown, about 2 minutes.", "Arrange chicken and pork on serving plate and keep warm.", "Strain sauce through fine sieve, skim and discard fat.  Pour sauce over chicken and pork."
)

c("Heat oven to 350Â°F.", "Grease and flour two 9 inch round baking pans or one 13x9 inch pan.", "In large mixer bowl, stir together dry ingredients.", "Add eggs, milk, oil, and vanilla; beat on medium speed for 2 minutes.", "Stir in boiling water by hand (batter will be thin). NOTE: I have tried it with 1/2 cup, 2/3 cup and 3/4 cup boiling water and we prefer it with less than 1 cup water. I usually use between 2/3 & 3/4 cups. The cake is still very moist but it doesn't seem to \"fall\" as much as it cools. This might have to do with our high humidity or brand of flour or other factors so I don't know if it will work for everyone.", 
"Pour into prepared pan.", "Bake 30 to 35 minutes for round 9-inch pans, 35 to 40 minutes for rectangular pan or until wooden pick inserted in center comes out clean. (Do not use 8-inch pans or the batter will overflow.).", "Because they have a tendency to overflow if you fill them more than 2/3 full, I usually get about 27-28 cupcakes per batch. Bake for approximately 18-20 minutes.", "Cool 10 minutes; remove from pan to wire racks.", "Please note: baking cocoa isn't hot chocolate drink mix! Baking cocoa contains no sugar and it is found on the baking aisle. Chocolate drink mixes that you add to milk or water to drink WILL NOT work in this recipe."
)

c("Prepare sauce:  In a small saucepan, stir together cornstarch and water until smooth.", "Gradually stir in chicken broth, mushrooms (if desired), butter, soy sauce and bouillon granules.", "Bring the mixture to a boil, stirring constantly.", "Let boil 1 minute.  Keep warm.", "Prepare batter:  Beat together cornstarch, flour, baking powder, egg and water until smooth.", "Coat each piece of chicken with batter.", "Pour vegetable oil into a large skillet or wok to the depth of 1/2 inch; heat to 375 degrees.", 
"Cook coated chicken pieces in oil, turning once, until golden -- 5 to 7 minutes.", "Drain on pa per towels.", "Cut chicken diagonally into strips.", "Reassemble strips in chicken breast shapes and place on a bed of shredded lettuce.  Sprinkle with almonds and green onion.", "Spoon sauce over chicken and serve immediately.", "Makes four to six servings.", "It's been some time since I last made this, but I recall that the batter seemed not quite the same, but the rest is authentic.  This can also be made with duck, in which case it becomes Warr Shu Opp."
)

c("Measure carefully, placing all ingredients except cornmeal in bread machine pan in order specified by owner manual.", "Program dough cycle setting; Press start.", "When dough is finished, remove dough from bread machine and let it rest 2 - 3 minutes.", "Pat and gently stretch dough from edges until dough seems to not stretch anymore.  Let rest 2-3 minutes more.  Continue patting and stretching until dough is 12 - 14 inches in diameter.", "Spray 12-14 inch pizza pan with cooking spray; Sprinkle with cornmeal, if desired.", 
"Press dough into pan; Cover with towel and let stand in warm place for about 10 minutes  ***  I have added toppings with the dough from here and baked and it's great! But the recipe continues on -- ***", "Position oven rack in lowest position; Preheat oven at 500Â°F Prick crust with fork at 2 inch intervals, Bake 4 - 5 minutes or until top is dry but not yet golden.", "Remove from oven.", "Follow topping and baking directions for individual recipes.", "Makes 1 thick 12-inch crust or 1 medium-thick 14 inch crust. *** I've also been known to add garlic to this recipe.*** Enjoy!"
)

c("Combine fruits and reserve a small amount for garnish.", "Spread approximately 1/2 of cake into bottom of trifle dish.", "Then place a layer of 1/2 of combined fruits.", "Follow with a layer 1/2 of pudding.", "Repeat the cake layer, fruit layer and pudding layer Top with a layer of Cool Whip and garnish with reserved fruit.  Lemonade Cake You will need: 1 - 3 oz pkg lemon Jello 3/4 cup hot tap water 1 lemon cake mix 4 eggs 3/4 cup oil 1 can frozen lemonade concentrate 1 cup sugar Preheat oven to 300.", 
"Grease and flour a Bundt pan.", "Dissolve Jello in hot water  and set aside - DO NOT JELL.", "In a large bowl, mix next 3 ingredients.", "Add Jello  and beat together 3 minutes.", "Turn into Bundt pan.", "Bake 1 hour or until inserted  knife comes out clean.", "Meanwhile: While cake is baking mix next 2 ingredients and let sit. While cake is still warn, loosen it from edges of pan but leave cake in pan.", "Pour lemonade mixture over cake allowing it to run down the sides.", "Save some lemonade mixture. When you turn your cake out onto your, rack put some wax paper under rack and pour saved lemonade mixture over top of cake. This cake is simply divine."
)

c("Melt butter in heavy large skillet over medium-low heat.", "Add 12 chopped green onions and garlic and saute 3 minutes.", "Add white wine and simmer 15 minutes, stirring occasionally.", "Mix in fresh lemon juice. Season to taste with pepper.", "Transfer to large bowl and let cool.", "Cut shrimp down back through shell; do not peel.", "Remove veins.", "Add shrimp and 1 cup parsley to garlic mixture and toss well.", "Cover and chill 6 hours, turning occasionally.", "Prepare barbecue (medium-high heat). Remove shrimp from marinade. Thread 2 shrimp on each skewer.", 
"Transfer marinade to heavy medium saucepan.", "Simmer over medium heat until thick, stirring occasionally, about 12 minutes.", "Strain through a sieve, set over a bowl, pressing on solids.", "Season marinade with pepper sauce and salt. Spoon into 8 small ramekins; sprinkle with minced onion and 3 Tbsp parsley.", "Place 1 ramekin on each plate. Place shrimp on grill and cook until just pink and cooked through, turning once, about 3 minutes.", "Divide shrimp among plates.", "Garnish with lemon wedges and serve."
)

c("Preheat oven to 350 degrees.", "Peel the onion, leaving the roots trimmed but intact. Cut in 1/4-inch slices from stem to root, but don't cut through the root end. (A needle or skewer stuck through the root will prevent this.)", "Turn each onion at right angles and cut again so that when you stand it on its root end, it will form a chrysanthemum design.", "For another style, cut nearly through the root, turn and cut again, as you would with pie wedges, at 45-degree angles.", "Don't worry about any loose onion sections in the middle. Oil a baking dish lightly.", 
"Salt the onions and place them on their root ends in baking dish.", "Sprinkle vinegar over each onion and dribble butter over them until they are well coated and there is an excess in the pan for basting.", "Cover lightly with foil and bake for 1 to 1 1/2 hours, basting several times.", "Add a few chopped pecans to the center of each onion and continue baking together 1/2 hour.", "Remove from oven; season with salt and pepper, and sprinkle with chopped parsley.", "Serve hot or at room temperature. They may also be refrigerated and served cold."
)

c("Sift the flour, icing sugar and salt together four times.", "Place the egg whites  in a large bowl.", "Add the vanilla, orange extract and peel.", "Beat egg whites until foamy.", "Add the cream of tartar and keep beating until firm but still glossy.", "Add the granulated. sugar 2 Tbsp. at a time to the egg whites.", "Continue beating  until the cling to the sides of the bowl and are stiff but not dry.", "Fold in  flour mixture a little at a time. Do not stir! Spoon batter into ungreased tube  pan.", 
"cut through batter to release any air bubbles and gently smooth top.", "Bake  at 350 degrees F for 45-50 minutes or top springs back when gently touched.", "Cool upside down.", "Top with Orange Glaze. Orange Glaze 1 1/4 cup icing sugar 1/2 cup orange juice 1 tsp.", "vanilla grated peel of one orange Mix all ingredients together with a wooden spoon and spread on top of cake, allowing some to dribble down the sides.", "A family oriented website      http://home.sprynet.com/~jmjohnsn      Seasonal Page Topic - Ice Cream          New Appetizer Recipes Page"
)

c("In 2 quart sauce pan place 3 tablespoons butter  and sliced onions.", "Cook at low  to medium heat  stirring frequently until soft and clear but not brown.", "Add  chicken broth from can, chicken bouillon  cubes, salt, pepper, and stir until  completely heated  through.", "Add white sauce and Velveeta cheese.  White sauce  will be thick because it has been  removed from the heat. Simmer on medium low  heat  until the cheese is melted and all ingredients are  blended, stirring  constantly.", "Turn temperature to  warm and let cook for additional 30 to 45 minutes.", 
"Serve with a garnish of shredded cheddar cheese,  and a couple of slices of warm dark Russian Bread.", "Thick White Sauce:", "In a 1 quart sauce pan melt butter and add flour,  cook on medium heat until the flour turns thick and  comes away from the sides of the sauce pan.", "Pour  milk in  flour a little at a time and stir constantly, add  salt. Mixture should thicken  and become like thick  pudding.", "Remember to stir constantly taking care  not to  let mixture lump, set aside off from heat until  ready to use for the soup."
)

c("Boil Potatoes for 10-15 minutes checking them for softness with a fork.", "You  want them to be soft, but not falling apart or fully cooked.", "Cube the potatoes  into approx.", "1/2 to 1 inch cubes, not to thick or thin.", "Spread 2-3 tablespoons  of the oil onto a nonstick cookie sheet. Preheat oven to 350 degrees.", "Put  potatoes on sheet spreading them around in the oil, but keeping them away from  direct contact with the side of the sheet.  Season with garlic salt, onion salt  and dill.", 
"(This should be over all potatoes, but depending on how much you want to flavor them, it is variable..", "I moderately-generously season them). Pepper to taste.  Cook for 25-30 minutes or until done.  Slightly golden brown.", "Halfway  through check potatoes and stir around on sheet.  If oil has cooked out, add the remaining oil, keeping potatoes moist but not saturated.", "After done, remove  from oven and place in bowl, generously sprinkling Parmesan cheese over them.", "Stir well and serve, making sure each potato has some Parmesan cheese on it!!!   Enjoy!!! Sarah Smith"
)

c("Cook the beans over gentle heat for 45 minutes or an hour at the most (an hour-and-a-half if they are dried, after soaking in water, together with the herbs and garlic, for a couple of hours). In either case, do not add salt which tends to harden the skins.", "Purie by putting through a vegetable mill, carefully eliminating the husks.", "Put the garlic, rosemary, sage and cubed bacon to sauti briefly in a saucepan with 4 tablespoons of oil.", "Pour on the bean purie. Season lightly with salt and the red hot pepper to taste. Stir to blend the flavours and bring slowly to the boil.", 
"Throw the pasta into the purie and cook until firm, diluting with a little of the bean cooking water, but only if necessary - the soup must be thick and rather solid.", "It is excellent hot, but is absolutely delicious if heated up with the addition of a drop of first-rate olive oil.", "If you prefer, leave a few beans whole and add them to the saucepan with the purie. Some cooks hold that a carrot is not out of place in the mirepoix (but then cut out the bacon), or that the soup loses nothing if you add a little tomato, even tomato concentrate (paste)."
)

c("For Cobbler:  In food processor, combine flour, sugar, baking powder, and salt.  Pulse  to combine.  Add cold butter and pulse until mixture is crumbly.", "Drizzle  most of buttermilk /cream over flour mixture, pulse to combine. If mixture seems dry, add a little more.  Dough should be just moist.  Gather the dough and  spread out onto lightly floured parchment or waxed  paper.", "Patting into a Disc  a little less than 1/2-inch thick chill for  1/2 hour.", "For Fruit:  Slice  peaches into wedges, toss with lemon juice.  In a small bowl, combine  cornstarch, spices, pinch of salt and lemon zest.  Toss with the peaches and  pour unto lightly greased 8-inch baking dish.", 
"To assemble:  On a lightly  floured surface, using a fluted cutter or any shaped cutter, cut out biscuits.", "Gently re-roll scraps and arrange over fruit, slightly overlapping.", "Brush  biscuits with cream.", "In a small bowl, combine almonds, brown sugar and  cinnamon.", "Sprinkle over dough.", "Place in the oven and cook until fruit is  bubbling, biscuits are golden,  and a skewer poked into the center of the  biscuit dough comes out clean.", "Serve warm with ice cream, heavy cream or creme anglaise."
)

c("Have some boiling water, with salt and one of those chicken  stock cubes in it and a tablespoon of butter.", "When it starts to boil, add the  Spaghetti or any other type of pasta.", "After about 10-15 minutes, the pasta  should be cooked (try it and see if its not hard) Remove the water, stir a  little bit with a fork (don't squish it!) and let it dry for about one minute.   You can eat the pasta like this it's good, but you'll be fed up with it in no  time, so, the solution I found is to add some nice sauce: Start making the sauce about 5 minutes after the pasta's been boiling Have some  oil or olive oil on a frying pan or a small pan.", 
"Add half an onion cut into  little pieces.", "When the onion starts to get transparent and soft add a little  bit of concentrated tomato, just about 4-5 table spoons.", "Stir (have the fire set to LOW) Add half a cup of water and stir again.", "Add salt, pepper, nutmeg,  mustard, lemon juice, and any sort of seasoning you like, and let it cook for a  couple of minutes.", "And there, you have your basic sauce recipe, if you're vegan, just pour it over  the pasta, it's very tasty.", "If you're not vegan you'll soon get fed up with this to, to solve that problem, simply add whatever you want to the sauce, it's  excellent with canned tuna, mushrooms, fish leftovers, meat, ham, really  ANYTHING you like! And the great thing is that the sauce has a completely  different taste depending on what you add to it. I hope this helps :)"
)

c("Butter cookie sheet generously.", "Wash and dry waxed apples thoroughly.", "Insert  wooden skewer in stem end of each apple. Mix sugar, water, corn  syrup  and food color in 2-quart heavy saucepan.", "Heat to boiling over high heat;  reduce  heat.  Boil gently, without stirring, to 290 on candy thermometer or until  small  amount  of mixture dropped into very cold water separates into threads that are  hard but  not brittle. Stir in clove oil.", "Dip apples quickly into syrup,  twirling  until completely coated.", 
"Stand on cookie sheet; cool.", "MICROWAVE DIRECTIONS:  Mix sugar, water, corn syrup and food color in 1  1/2-quart glass  casserole.  Microwave uncovered on high 19 to 23 minutes,  stirring once after 5  minutes, to 290 on microwave candy thermometer or until  small amount of mixture  dropped  into very cold water separates into threads  that are hard but not  brittle. Stir in clove oil.", "Dip apples quickly into  syrup.", "Continue as directed.", "NOTES : Pour any remaining syrup onto buttered cookie sheet. Cool; break  into small pieces for a treat."
)

c("Rinse the cavity well with water and dry; set meat to the side.", "Mix together and cook the liquid ingredients for 5 minutes.", "Mix the bread cubes, celery and seasonings together.", "Stuff the abdominal cavity firmly with the stuffing and sew up the opening or use skewers to seal.", "Fit aluminum foil caps over the ears and tail to avoid burning.", "These caps should be removed about l/2 hour before  the barbecue is completed to obtain a uniform baking color.", "Leave a wooden  block in the pig's mauth, so that a red apple can be inserted when the barbecue is completed.", 
"Briquettes are placed only on the sides of the charcoal grill and are separated from the suckling pig by the walls of a foil drip pan.  (To make this  drip pan, use 3 sheets of heavy aluminum foil molded slightly larger than the  pig to collect the rich drippings.).", "Place the cooking grill over the foil drip pan.  (This will allow you to add more briquettes as needed, and to collect the basting fluids.).", "Liberal usage of marinade on partially cooked suckling pig enhances the finished entree."
)

c("This is an easy recipe, although time consuming.", "Prepare the brisket, cook it  thoroughly, whether you cook on the  grill or in the oven.", "The oven method is  easy, I use a cooking bag, spice  it with salt, pepper, chopped onion, smoke  flavored sauce, or any  steak sauce.  Once the beef is done, using the leanest  part of the  brisket, chop the meat finely, set aside in an oven proof pan,  cover  with tin foil and return to a warm oven.", "Heat up the margarine as  indicated above, heat  up a frying pan, I use a cast iron one, using tongs, dip  a corn tortilla  into the butter and drop into the frying pan, heat on one side  turn  an heat the other, takes about 60 seconds total.", 
"Tortilla should  not be  soggy.", "Heat a pile of them and wrap in tin foil and place in the  oven to keep  warm.", "Wash jalapenos, dry and toss in the pan after  you have heated the  tortillas, doing so before hand will make the  tortillas taste hot, you may add  a little lime butter to make them cook  faster.", "Grill the jalapenos in the pan  until they are soft, usually  five to seven minutes, they will wilt, put aside  in a bowl,  ceramic or glass, plastic will pick up the flavor.", "Mix together the chopped onion and cilantro,  toss with the fresh lime juice. To assemble the tacos:  Get one tortilla, place about 2 tablespoons of  chopped  meat in the tortilla, add one tablespoon of onion mixture  and if you dare one  jalapeno whole! With the left over meat from  the brisket, you can freeze it and make  barbecue sandwiches out of them."
)
